import React from "react";
import styled from "styled-components";
const Button = styled.button`
  background-color: #282c34;
  color: Grey;
  font-size: 20px;
  padding: 10px 10px;
  border-radius: 10px;
  margin: 10px 0px;
  cursor: pointer;


`;

function clickMe(){
    alert("David is cute!");
}


const Search = () => (
    <form action="/" method="get">
        <label htmlFor="header-search">
            <span className="visually-hidden">How do you feel today?</span>
        </label>
        <input
            type="text"
            id="header-search"
            placeholder="Deez"
            name="s" 
        />
        <button type="Submit">Search</button>
    </form>
);

export default Search;
